import React, { Component } from 'react';
import { ThemeProvider } from 'styled-components';

import { Board } from './game';
import '../../style/sudoku.css';




export default class SudokuGame extends Component {
  state = {
    theme: {
      name: 'Light Orange',
      primary: 'rgba(255,90,0,1)',
      secondary: 'rgba(60,60,120,1)',
      board: 'rgba(255,90,100,0.7)',
      overlay: 'rgba(255,90,0,0.2)',
      background: 'white',
      original: 'rgba(102, 102, 102,1)',
      inverted: 'black',
    },
  };

  render() {
    const { theme } = this.state;
    const {
      onComplete,
      difficulty,
      hide,
      CustomResetModal,
      CustomValidateModal,
    } = this.props;
    return (
      <div>
        <div id="sudoku_header">Sudoku</div>
        <ThemeProvider theme={theme}>
          <div className='sudoku_board'>
            <Board
              hide={hide}
              onComplete={onComplete}
              difficulty={difficulty}
              CustomResetModal={CustomResetModal}
              CustomValidateModal={CustomValidateModal}
            />
          </div>
      </ThemeProvider>
      </div>

    );
  }
}
